import React from "react";
import {Link} from "react-router-dom";


const NavBar = () => {

    const myFunction = () => {
        var x = document.getElementById("navId");
        if (x.className === "navigationBar") {
          x.className += "responsive";
        } else {
          x.className = "navigationBar";
        }
    }
    return (
    <div className="navigationBar" id="navId">
              <ul>
                  <li><a href="/" className="navnav">About</a></li>
                  <li><Link to="/work" className="navnav">Work</Link></li>
                  <li><Link to="/contact" className="navnav">Contact</Link></li>
                   <a href="javascript:void(0);" className="icon" onclick= {myFunction()}>
                        <li><i className="fa fa-bars"></i></li>
                  </a>
             </ul>
    </div>

    )
}

export default NavBar;
